import React, {Component} from 'react';
import './price-row.css';
import Card from 'react-bootstrap/Card'
import CardDeck from 'react-bootstrap/CardDeck'
class PriceRow extends Component {

  constructor(props) {
    super();

      this.state = {
        pricerow: [],
      };
}
componentDidMount(){

  //return fetch('http://192.168.0.100:4440/24h')
  return fetch('https://api.binance.com/api/v1/ticker/24hr')

             .then((response) => response.json())
             .then((responseJson) => {
               console.log(responseJson)      
                this.setState({
                pricerow: responseJson

               })

             })
             .catch((error) => {
               if(error === 'TypeError: Network request failed'){
                 console.log('error internet')
               }
               console.error(error);
             });      
}



  render(){

    return(
        <CardDeck>
          <Card>
            <Card.Img variant="top" src="./images/carousel1.jpg/100px160"alt="" />
            <Card.Body>
              <Card.Title>Card title</Card.Title>
              <Card.Text>
                This is a wider card with supporting text below as a natural lead-in to
                additional content. This content is a little bit longer.
              </Card.Text>
            </Card.Body>

          </Card>
          <Card>
            <Card.Img variant="top" src="holder.js/100px160" />
            <Card.Body>
              <Card.Title>Card title</Card.Title>
              <Card.Text>
                This card has supporting text below as a natural lead-in to additional
                content.{' '}
              </Card.Text>
            </Card.Body>
            <Card.Footer>
              <small className="text-muted">Last updated 3 mins ago</small>
            </Card.Footer>
          </Card>
          <Card>
            <Card.Img variant="top" src="holder.js/100px160" />
            <Card.Body>
              <Card.Title>Card title</Card.Title>
              <Card.Text>
                This is a wider card with supporting text below as a natural lead-in to
                additional content. This card has even longer content than the first to
                show that equal height action.
              </Card.Text>
            </Card.Body>
            <Card.Footer>
              <small className="text-muted">Last updated 3 mins ago</small>
            </Card.Footer>
          </Card>
        </CardDeck>
        //  <div className="price">
        //  
        //  </div>
    );
  }

}

export default PriceRow;
